import React from "react";
import AppLayout from "../components/AppLayout";
import Head from "next/head";
const Profile = () => {
  const followerList = [
    { nickname: "박철수" },
    { nickname: "김철수" },
    { nickname: "안철수" },
  ];
  const followeignList = [
    { nickname: "박철수" },
    { nickname: "김철수" },
    { nickname: "안철수" },
  ];
  return (
    <>
      <Head>
        <title>내 프로필</title>
      </Head>
      <AppLayout>프로필 페이지</AppLayout>
    </>
  );
};

export default Profile;
